"use strict";Object.defineProperty(exports,"__esModule",{value:!0}),exports.default=void 0;var e={icu_transfers:{banner_title:"Predicting ICU Transfers",banner_headline:"Saving Lives by Catching Patients Before the Crash with AI",challenge:"Studies show that patients who undergo an unplanned transfer to the ICU experience worse outcomes than patients admitted directly. These patients typically stay in the hospital 8 to 12 days longer and have significantly higher mortality rates  these patients account for only 5% of patients but represent one-fifth of all hospital deaths. The challenge is to find patients before they crash and need to be moved to the ICU, but these patients often dont have symptoms that clinicians can recognize as leading to a serious change in condition.",solution:"AI models can be used to find patients who are likely to crash. The machine learning models use patient medical records, laboratory results, and vital signs from patients to find early warning signals of deteriorating condition. These models can then be used with existing patients in realtime to determine their risk of a crash and as part of an early warning system for clinicians so they can intervene before the ICU transfer is needed. The AI system can also provide reason codes for a particular patient, which can help clinicians understand where they should begin their treatment.",why_h2o:"The mission at H2O.ai is to democratize AI for all so that more people across industries can use the power of AI to solve business and social challenges. The healthcare industry is a key focus for the company with an initiative to help develop AI healthcare solutions including dedicated, experienced resources for customers, driving healthcare AI events and meetups for healthcare professionals, and membership in Health IT Now, the leading coalition of patient groups, provider organizations, employers, insurers, and other stakeholders. H2O.ai is already working with top healthcare companies including Change Healthcare, Armada Health, Kaiser Permanente, and HCA, and its products include industry leading features for machine learning interpretability required by the healthcare industry for compliance purposes."},medical_testing:{banner_title:"Medical Testing",banner_headline:"Predicting Medical Test Results with AI",challenge:"According to the National Academy of Medicine, waste in healthcare is widespread and is estimated to be about a fourth of all the money spent on healthcare each year, a staggering $765 billion annually. One of the key areas of waste is unneeded testing or routine tests that are rarely used. The number of tests can add up for an individual patient and result in significant costs that do not contribute to the quality of care or positive patient outcomes.",solution:"AI based solutions can be used to help clinicians make better decisions by narrowing the types of tests that are likely to be useful for a patient. AI models can be created using volumes of patient information from healthcare systems together with data from pharmaceutical companies to predict likely test results a given patients. This model is then deployed into an AI-driven application that can provide indications of which tests are likely to produce definitive or valuable results based on the patients medical history and current symptoms. With this knowledge, the clinician can pursue treatments with the best outcomes and minimize the number of tests, which saves time and reduces costs to the patient.",why_h2o:"The mission at H2O.ai is to democratize AI for all so that more people across industries can use the power of AI to solve business and social challenges. The healthcare industry is a key focus for the company with an initiative to help develop AI healthcare solutions including dedicated, experienced resources for customers, driving healthcare AI events and meetups for healthcare professionals, and membership in Health IT Now, the leading coalition of patient groups, provider organizations, employers, insurers, and other stakeholders. H2O.ai is already working with top healthcare companies including Change Healthcare, Armada Health, Kaiser Permanente, and HCA, and its products include industry leading features for machine learning interpretability required by the healthcare industry for compliance purposes."},hospital_readmissions:{banner_title:"Hospital Readmissions Prediction",banner_headline:"Preventing Readmissions and Saving Lives with AI",challenge:"Patients with serious and chronic illnesses are treated in the hospital and then discharged. Unfortunately, according to multiple studies, up to 25% of these patients will be readmitted within 30 days to be treated again, often with less favorable outcomes. With a focus on value-based care, providers are trying to prevent unnecessary readmissions and improve patient care outcomes. Readmission can be significantly reduced by taking steps while the patient is still hospitalized, defining different actions during discharge, and taking steps post discharge to ensure compliance with home care regimens.",solution:"AI is ideally suited to tasks where the data inputs are complex and may elude clinicians. Readmissions risk prediction can require data about the specific patients recent care, their current condition, treatment, their home life and other risk factors from electronic medical records. AI models can use this information to provide a proactive assessment of their risk and notify clinicians while the patient is still hospitalized. AI can provide the reasons that will lead to readmission and also provide recommendations for the types of treatments that are most likely to be successful given the patients history. The reason codes are valuable to clinicians because they can pinpoint areas to focus on when developing a care plan for the patient and prevent unnecessary and costly tests.",why_h2o:"The mission at H2O.ai is to democratize AI for all so that more people across industries can use the power of AI to solve business and social challenges. The healthcare industry is a key focus for the company with an initiative to help develop AI healthcare solutions including dedicated, experienced resources for customers, driving healthcare AI events and meetups for healthcare professionals, and membership in Health IT Now, the leading coalition of patient groups, provider organizations, employers, insurers, and other stakeholders. H2O.ai is already working with top healthcare companies including Change Healthcare, Armada Health, Kaiser Permanente, and HCA, and its products include industry leading features for machine learning interpretability required by the healthcare industry for compliance purposes."},claim_denials:{banner_title:"Claim Denials Management",banner_headline:"Streamlining the Claims Process with AI",challenge:"On average, 24% of claims are denied during the evaluation and payment process, according to the Doctor-Patients Rights Project. Denied claims are large expense for providers and painful for patients who have to pay out-of-pocket or providers who have to write off as losses. Existing claims management processes are highly manual with analysts and rules making choices about which claims to work for resubmission with their limited time.",solution:"An AI approach uses machine learning models to streamline the denials management process by finding claims that have a high likelihood of being paid and the highest potential value. By working these claims first, the providers and payers spend the time on those claims that are most likely to be valid and will yield the most value to patients and providers. AI models can also provide reason codes for the denial which streamlines the review process by allowing the investigator to focus on the key issues. Reason codes are also helpful for patients and providers because they can inform them of issues with their claim and help them to fix the claim for reprocessing or change future claims to avoid issues.",why_h2o:"The mission at H2O.ai is to democratize AI for all so that more people across industries can use the power of AI to solve business and social challenges. The healthcare industry is a key focus for the company with an initiative to help develop AI healthcare solutions including dedicated, experienced resources for customers, driving healthcare AI events and meetups for healthcare professionals, and membership in Health IT Now, the leading coalition of patient groups, provider organizations, employers, insurers, and other stakeholders. H2O.ai is already working with top healthcare companies including Change Healthcare, Armada Health, Kaiser Permanente, and HCA, and its products include industry leading features for machine learning interpretability required by the healthcare industry for compliance purposes."},clinical_workflow:{banner_title:"Clinical Workflow Improvement",banner_headline:"AI Provides a Helping Hand to Clinicians",challenge:"Clinicians are often overworked, and hospitals are understaffed. Various studies estimate a diagnosis error rate of 10  15% which has a huge impact on those patients and the providers. Early diagnosis of critical conditions like Sepsis or Intracranial Hemorrhage has a significant effect on patient outcomes.",solution:"AI based decision support and diagnosis can help clinicians make better decisions by incorporating more data into the decision-making process and by learning patterns that are outside the clinicians purview. With mobile devices integrated into the clinical workflow, AI-based decision support helps doctors and nurses by providing a second opinion or by pointing out information they may have missed. These additional insights help the clinician make a more informed decision and can actual save time, expense and patient discomfort by preventing unnecessary tests.",why_h2o:"The mission at H2O.ai is to democratize AI for all so that more people across industries can use the power of AI to solve business and social challenges. The healthcare industry is a key focus for the company with an initiative to help develop AI healthcare solutions including dedicated, experienced resources for customers, driving healthcare AI events and meetups for healthcare professionals, and membership in Health IT Now, the leading coalition of patient groups, provider organizations, employers, insurers, and other stakeholders. H2O.ai is already working with top healthcare companies including Change Healthcare, Armada Health, Kaiser Permanente, and HCA, and its products include industry leading features for machine learning interpretability required by the healthcare industry for compliance purposes."},sepsis_prevention:{banner_title:"Sepsis Prevention",banner_headline:"80% of Sepsis Deaths Can Be Prevented with Rapid Diagnosis",challenge:"Sepsis is the leading cause of preventable death in U.S. hospitals with mortality from sepsis increasing 8% for every hour that treatment is delayed. As many as 80% of sepsis deaths could be prevented with rapid diagnosis and treatment according to Johns Hopkins Armstrong Institute for Patient Safety and Quality. Diagnosing sepsis can be difficult because its signs and symptoms can be caused by other disorders and there are no reliable biomarkers before onset. Doctors often must order a battery of tests to try to pinpoint the underlying infection which further delays treatment.",solution:"AI is particularly suited to situations where the signals of an issue are hidden by noise that obscures the actual problem from clinicians. Diagnosing Sepsis is one of those situations. AI driven early diagnosis based on routine vital signs and metabolic levels from electronic medical records can highlight patients at risk for Sepsis before they are admitted to the ICU where it may already be too late. AI can even be used to predict courses of treatment or dosage levels that are likely to be most effective based on patient history. Though early detection and more precision care, the patient is able to receive less aggressive and less costly treatments which improves patient outcomes and is better for payers and providers.",why_h2o:"The mission at H2O.ai is to democratize AI for all so that more people across industries can use the power of AI to solve business and social challenges. The healthcare industry is a key focus for the company with an initiative to help develop AI healthcare solutions including dedicated, experienced resources for customers, driving healthcare AI events and meetups for healthcare professionals, and membership in Health IT Now, the leading coalition of patient groups, provider organizations, employers, insurers, and other stakeholders. H2O.ai is already working with top healthcare companies including Change Healthcare, Armada Health, Kaiser Permanente, and HCA, and its products include industry leading features for machine learning interpretability required by the healthcare industry for compliance purposes."}},i=e;exports.default=i;
